const textareaDynamic = document.querySelector('._textarea-dynamic');
if (textareaDynamic) {
    const textarea = textareaDynamic.querySelector('textarea');
    const textareaCopy = textareaDynamic.querySelector('p');
    textarea.addEventListener('input', textareaAutoHeight);
    function textareaAutoHeight() {
        textareaCopy.textContent = textarea.value;
        const textareaStyles = window.getComputedStyle(textarea);
        const textareaLineHeight = textareaStyles.getPropertyValue('line-height');
        const textareaWidth = textarea.clientWidth;

        textareaCopy.style.lineHeight = textareaLineHeight;
        textareaCopy.style.fontSize = textareaStyles.getPropertyValue('font-size');
        textareaCopy.style.minHeight = textareaLineHeight;
        textareaCopy.style.width = textareaWidth + 'px';

        const defference = Math.round(textareaCopy.offsetHeight / parseFloat(textareaLineHeight));
        if (defference < 6) {
            textarea.style.height = textareaCopy.offsetHeight + 'px';
            textarea.style.overflow = 'hidden';
        } else {
            textarea.style.overflow = 'auto';
        }
    }
    textareaAutoHeight()
}


