swup.on('transitionStart', function () {
    const body = document.body;
    const header = document.querySelector('.header');
    body.style.paddingRight = window.innerWidth - document.querySelector('.wrapper').offsetWidth + 'px';
    body.classList.add('_lock');
    header.style.paddingRight = window.innerWidth - document.querySelector('.wrapper').offsetWidth + 'px';
});

function linkSwupChange() {
    const pathname = window.location.pathname;
    const pathNameArray = pathname.split('/');
    let pathBefore;
    if (pathNameArray.length > 2) {
        pathNameArray.pop();
        pathBefore = pathNameArray.join('/');
        const ahrefs = document.querySelectorAll('a');
        if (ahrefs.length > 0) {
            for (let index = 0; index < ahrefs.length; index++) {
                const ahref = ahrefs[index];
                if (ahref.getAttribute('href')[0] == '/' && ahref.getAttribute('href')[1]) {
                    ahref.setAttribute('href', `${pathBefore}${ahref.getAttribute('href')} `)
                }
            }
        }
    }
}

swup.on('transitionEnd', function () {
    const body = document.body;
    const header = document.querySelector('.header');
    if (body.classList.contains('_lock')) {
        body.classList.remove('_lock');
        header.style.paddingRight = "0px";
        body.style.paddingRight = "0px";
    }
});
